import { Layout, Menu } from 'antd'
import React, { Component } from 'react';
import {Link, Route} from 'react-router-dom'
import ArtistList from './ArtistList';

const { Content, Sider } = Layout;

export default class ArtistCat extends Component {
    render() {
        console.log(this.props);
        return (
            <Layout>
                <Sider style={{width: 250}}>
                    <Menu mode="inline" defaultSelectedKeys="hot">
                        <Menu.Item key="hot">热门歌手</Menu.Item>
                        <Menu.Item key="male">
                            <Link to="/artist/cat/0">男歌手</Link>
                        </Menu.Item>
                        <Menu.Item key="female">女歌手</Menu.Item>
                        <Menu.Item key="group">组合/乐队</Menu.Item>
                    </Menu>
                </Sider>
                <Content style={{ padding: '0 px', minHeight: 280}}>
                    <Route path="/artist/cat/:artistType" component={ArtistList} />
                </Content>
            </Layout>
        )
    }
}
